import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import Navbar from '../components/Navbar';

const Home = ({ username, role, handleLogout }) => {
  const navigate = useNavigate();

  useEffect(() => {
    if (username) {
      if (role === 'enterprise') {
        navigate('/dashboard/enterprise');
      } else {
        navigate('/dashboard/user');
      }
    }
  }, [username, role, navigate]);

  return (
    <div className="bg-gray-100 min-h-screen">
      <Navbar />
      <div className="flex flex-col items-center justify-center text-center mt-32 space-y-8">
        {/* Main Content */}
        <div>
          <h1 className="text-6xl font-extrabold text-gray-800 mb-4">Welcome!</h1>
          <p className="text-xl text-gray-600 mb-8 max-w-xl mx-auto">
            This is a sleek and modern template for a full-stack app. Explore the features by logging in or registering below.
          </p>
        </div>
        <div className="space-y-4">
          <button
            onClick={() => navigate('/login')}
            className="block bg-blue-500 hover:bg-blue-600 text-white px-8 py-4 rounded-lg text-2xl shadow-lg transition duration-300 transform hover:scale-105"
          >
            Login
          </button>
          <button
            onClick={() => navigate('/register')}
            className="block bg-green-500 hover:bg-green-600 text-white px-8 py-4 rounded-lg text-2xl shadow-lg transition duration-300 transform hover:scale-105"
          >
            Register
          </button>
        </div>
      </div>
    </div>
  );
};

export default Home;
